INSERT INTO `bd_contacts` VALUES (45, '王富贵', 1, '1', ' ', 27, 48, '王富贵', '2016年10月13日，2016年胡润百富榜，王富贵以455亿财富排名第26位。 2016年10月18日，2016胡润IT富豪榜，王富贵以420亿元排名第7。 2016年10月27日，2016福布斯中国富豪榜公布，王富贵排名第16位。', ' ', '王富贵', '王富贵', '王富贵', '王富贵', '王富贵', '王富贵', '王富贵', '2021-03-09 00:00:00.000', '王富贵', 1, 78, '王富贵', '2022-04-26 00:00:00.000', '王富贵', '2022-04-26 00:00:00.000', '2015年4月25日(波士顿时间)，王富贵受邀在哈佛中国论坛进行主题演讲。 2015年1月31日，王富贵会见法国总理瓦尔斯，并于2月赴巴黎与法国政要签订“联合声明”，', '2016年10月13日，2016年胡润百富榜，王富贵以455亿财富排名第26位。\n2016年10月18日，2016胡润IT富豪榜，王富贵以420亿元排名第7。\n2016年10月27日，2016福布斯中国富豪榜公布，王富贵排名第16位。\n2016年11月，王富贵登上《福布斯杂志》封面。', 19, '2022-04-26 08:46:55.268', 1, '2022-05-24 09:58:06.863', b'1');
