INSERT INTO `bd_taskprocess_info` VALUES (35, 0, 20, 30, '10000000', '测试任务', '据悉，激光雷达是目前国际上权威、通用的测树方法，较之传统的测量方法更加客观、准确、精细。在本次测绘中，采用无人机与背包激光雷达相结合获取11棵潜在高于70米巨树的三维点云模型，进而对这些巨树进行高度的精准测量。\n\n经过为期10天的实地考察、数据采集与处理工作，最终发现了高达76.8米的不丹松巨树，该发现刷新了目前中国大陆最高树的纪录。研究团队获取了最高树的精细三维点云数据，并采用无人机获取照片拼接成巨树等身照。除此之外，测量团队还采用无人机悬吊测绳以及卷尺测量等方法，进行了高度和胸径验证，记录了详细的数据。\n\n在此次调查中，研究团队在背崩乡格林村共发现8棵高度在70米以上的巨树，高度从70.2米到76.8米，是目前中国大陆经过精准测量发现的巨树分布最多的区域，充分体现了雅鲁藏布大峡谷区域森林生态系统的原真性。\n\n研究团队建议将位于墨脱县格林村经准确测量的这棵最高不丹松大树取名为“辛达布”，本地门巴族语意为“神树”。不丹松是一种仅分布于东喜马拉雅地区的狭域分布树种，其主要分布范围为海拔1400米-2500米的山地雨林与亚热带气候区，这一地带具有优良的水热条件，生物多样性极其丰富。据李成介', '是', '是', '是', NULL, NULL, '据悉，激光雷达是目前国际上权威、通用的测树方法，较之传统的测量方法更加客观、准确、精细。在本次测绘中，采用无人机与背包激光雷达相结合获取11棵潜在高于70米巨树的三维点云模型，进而对这些巨树进行高度的精准测量。\n\n经过为期10天的实地考察、数据采集与处理工作，最终发现了高达76.8米的不丹松巨树，该发现刷新了目前中国大陆最高树的纪录。研究团队获取了最高树的精细三维点云数据，并采用无人机获取照片拼接成巨树等身照。除此之外，测量团队还采用无人机悬吊测绳以及卷尺测量等方法，进行了高度和胸径验证，记录了详细的数据。\n\n在此次调查中，研究团队在背崩乡格林村共发现8棵高度在70米以上的巨树，高度从70.2米到76.8米，是目前中国大陆经过精准测量发现的巨树分布最多的区域，充分体现了雅鲁藏布大峡谷区域森林生态系统的原真性。\n\n研究团队建议将位于墨脱县格林村经准确测量的这棵最高不丹松大树取名为“辛达布”，本地门巴族语意为“神树”。不丹松是一种仅分布于东喜马拉雅地区的狭域分布树种，其主要分布范围为海拔1400米-2500米的山地雨林与亚热带气候区，这一地带具有优良的水热条件，生物多样性极其丰富。据李成介', 1, '2022-05-09 08:54:41.455', 1, '2022-05-09 08:56:26.067', b'1');
