INSERT INTO `pro_dynamic` VALUES (28, 0, 54, '8月9日记录：1.设备装配调试中，配合问题处理优化下发必要工装；\n5/20：机械图纸路好新增4张\n6/6火焰喷涂现场问题：\n1.风道安装与主轴距离不足1m。\n原因底部的安装板与地基面导致无法后移。（地基更改）\n解决方案：原风道已拆除，需要新作连接管路。现场找供应商制作，并将风道安装板切除，避免干涉。后续安装按照离中心距1050进行安装。并制作相应的连接管道。\n现场配作脚踏盖板等。\n2.主机空转噪音较大，\n可能原因：同轴度偏差/购买的轴承座润滑剂不够（目前无法添加润滑油）—解决方案，现场调整。联系供应商，对轴承座进行添加润滑油。\n3.机械臂目前通讯无法连接\n易永忠现场解决，目前进行调试。\n4.其余工作：1）门安装电缸和固定安装座。并进行调整。\n2）布置风道及护罩，安装脚踏板等。路好出图。\n3）整体联调\n', NULL, NULL, 0, '0001-01-01 00:00:00.000', 0, '0001-01-01 00:00:00.000', b'0');
