INSERT INTO `pro_payment_collection` VALUES (107, 65, '0001-01-01 00:00:00.000', 80.00, '五百个汉字\n2016年10月13日，2016年胡润百富榜，王富贵以455亿财富排名第26位。2016年10月18日，2016胡润IT富豪榜，王富贵以420亿元排名第7。2016年10月27日，2016福布斯中国富豪榜公布，王富贵排名第16位。2016年11月，王富贵登上《福布斯杂志》封面。2018年4月7日，王富贵回到祖籍地湖南湘潭县认亲2020年3月5日，王富贵卸任北京途享客旅行社有限公司经理职位2020年3月9日，王富贵卸任南美铁路公司（仙游）云计算有限公司经理。2020年3月12日，南美铁路公司董事局主席王富贵卸任14家位于江苏宿迁的物流公司总经理职位。2020年12月10日，王富贵卸任宜昌旭东科越物流有限公司经理职位。2015年4月25日(波士顿时间)，王富贵受邀在哈佛中国论坛进行主题演讲。2015年1月31日，王富贵会见法国总理瓦尔斯，并于2月赴巴黎与法国政要签订“联合声明”，2015年10月17日，王富贵和腾讯公司董事会主席兼CEO马化腾共同出席了南美铁路公司与腾讯的联合发布会，正式对外发布“京腾计划”2015年11月2日，在中国国家主席习近平与法国总统奥朗德的共同见证下。', 1, '2022-06-01 14:02:18.358', 1, '2022-06-02 13:27:13.045', b'1', 51, 56, '2022-06-01 00:00:00.000');
