INSERT INTO `sys_notice` VALUES (2, '测试第二条通知', '<p>12 测试一张小图片<img src=\"data:image/jpeg;base64,\"></p><p><br></p><p>一个标准的富文本222</p>', 2, 0, 1, '2022-04-06 17:29:51.297', 1, '2022-04-07 17:34:01.663', b'1', NULL, NULL);
INSERT INTO `sys_notice` VALUES (3, 'pms3.0 更新通知', '<p>本次更新：</p><p>1、增加了通知管理功能，通知发布、编辑、管理、删除、预览。</p><p>待更新：</p><p>1、通知发布后，自动以消息的形式展现。</p><p><br></p><p>测试一张图片：图片使用Base64编码，如图片过大时，上传较慢，考虑使用上传控件统一上传文件。</p><p><img src=\"data:image/jpeg;base64,\"></p>', 3, 0, 1, '2022-04-06 17:32:11.314', 1, '2022-04-09 11:06:01.030', b'0', '新闻公告', '10,11,1');
INSERT INTO `sys_notice` VALUES (4, '123', '<p>123</p>', 0, 0, 1, '2022-04-07 10:29:59.071', 1, '2022-04-07 14:53:45.348', b'1', '公告通知', NULL);
INSERT INTO `sys_notice` VALUES (5, '123', '<p>123</p>', 0, 0, 1, '2022-04-07 10:31:27.260', 1, '2022-04-07 14:53:43.795', b'1', 'news', NULL);
INSERT INTO `sys_notice` VALUES (6, '123', '<p>311</p>', 0, 0, 1, '2022-04-07 10:33:47.864', 1, '2022-04-07 14:53:42.002', b'1', '默认', NULL);
INSERT INTO `sys_notice` VALUES (7, '123', '<p>321</p>', 0, 0, 1, '2022-04-07 11:40:01.431', 1, '2022-04-07 14:53:39.730', b'1', '新闻公告', NULL);
INSERT INTO `sys_notice` VALUES (8, '1', '<p>23</p>', 0, 0, 1, '2022-04-07 11:47:56.627', 1, '2022-04-07 15:02:16.778', b'1', '公告通知', '17,15,9,10');
INSERT INTO `sys_notice` VALUES (9, '', '', 0, 0, 1, '2022-04-07 11:49:23.855', 1, '2022-04-07 14:53:07.843', b'1', '新闻公告', NULL);
INSERT INTO `sys_notice` VALUES (10, '指定用户发送通知', '<ul><li><span class=\"ql-size-large ql-font-monospace\">系统可以指定人任意用户进行通知。</span></li><li><span class=\"ql-size-large ql-font-monospace\">修改</span><u class=\"ql-size-large ql-font-monospace\">不会导致</u><span class=\"ql-size-large ql-font-monospace\">重新发布，必须点击发布，才能真正的让用户看到。</span></li><li><span class=\"ql-size-large ql-font-monospace\">当未选择通知用户时，系统将发送给所有人。</span></li></ul>', 0, 0, 1, '2022-04-07 11:50:10.701', 1, '2022-04-07 15:07:47.266', b'0', '新闻公告', '11,10');
INSERT INTO `sys_notice` VALUES (11, '消息功能正式启用', '<p>PMS3.0消息功能正式启用。</p><p><br></p><p>目前支持的消息有：</p><p>1、发布公告消息。</p><p><br></p><p>将要支持的功能：</p><p>1、审批消息。</p><p><br></p><p>2022-04-12 更新说明：</p><p>1、预加入工作流组件，在进一步需求分析中。 </p><p>2、角色管理，左侧导航大小宽度调整。</p><p>3、增加：增加了文章发布功能。</p><p>4、增加：增加消息管理发送和显示功能。（待完善，建议周期性检查或使用WebSocket检查实时消息）</p><p>3、修复：当发布后，菜单管理的图标选择不可用问题。（mock失效了，现改为直接返回，不走网络）</p><p>4、优化：部门管理中，调整最多只显示2级部门领导，改为递归，显示所有的部门领导。</p><p>5、优化：用户管理中，使用部门筛选，可以筛选出所有子部门的用户。</p>', 0, 1, 1, '2022-04-12 10:02:49.246', 1, '2022-04-12 10:47:58.033', b'0', '新闻公告', NULL);
INSERT INTO `sys_notice` VALUES (12, '单独消息', '<p>这个消息只发送给 yuanyong 其他人收不到此消息。</p><p><br></p>', 0, 1, 10, '2022-04-12 15:40:15.431', 1, '2022-04-12 15:50:09.612', b'0', '公告通知', '10');
INSERT INTO `sys_notice` VALUES (13, '只发给Admin的通知', '<p>其他人看不到的消息，测试发布功能。</p>', 13, 1, 1, '2022-04-12 16:08:05.908', 1, '2022-04-19 17:37:19.044', b'0', '公告通知', '1');
